import "./navbar.css";

import React from "react";

export default function NavBar() {
  return (
    <div className="navbar">
      <div className="navbarLeft">Left</div>
      <div className="navbarCenter">Right</div>
      <div className="navbarRight">Middle</div>
    </div>
  );
}
